import React, { Component } from "react";
import Reveal from "react-reveal/Reveal";
class TeamWidget extends Component {
  render() {
    return (
      <Reveal effect="fadeInUp" duration={1800}>
        <div className="col-lg-3 col-md-6">
          <div
            className="f_widget about-widget pl_70 wow fadeInLeft"
            data-wow-delay="0.4s"
          >
            <h3 className="f-title f_600 t_color f_size_18 mb_40">
              {" "}
              MicroGlobe, markalar ve etkileyiciler için veri odaklı otomatik
              bir influencer pazarlama platformudur.
            </h3>
          </div>
        </div>
      </Reveal>
    );
  }
}

export default TeamWidget;
